import React from 'react'
import {useSpring ,animated} from 'react-spring';

function App() {
  const props = useSpring({
    color:"#ff0000",
    from: { color: "#0000ff" },
  })
  return (
    <div>
       <animated.h1 style={props}>hello</animated.h1>
    </div>
  )
}



export default App
